import React from "react";
import {Route} from "react-router-dom"

const Routes = () =>{

    return(
        <div className="Routes">
        <Route exact path="/"/>
        <Route path="/login"/>
        <Route path="/home"/>
        </div>
    )
}

export default Routes;
